import Stars from "./Stars";
import starsColored from "../../../assets/img/stars/starsColored.png";
import starsGrey from "../../../assets/img/stars/starsGrey.png";
import "./StarsList.scss";

const StarsList = (props) => {
  const number = +props.value;
  let starsTotal = [];

  if (number > 0) {
    for (let i = 0; i < number; i++) {
      starsTotal.push(
        <Stars key={Math.floor(Math.random() * 10)} image={starsColored} />
      );
    }
  } else {
    for (let i = 0; i < 5; i++) {
      <Stars key={Math.floor(Math.random() * 10)} image={starsGrey} />;
    }
  }

  if (starsTotal.length !== 5) {
    console.log("ntm");
    // for (let i = starsTotal.length; starsTotal.length >= 5; i++) {
    //   starsTotal.push(starsGrey);
    // }
  }

  return starsTotal;
};

export default StarsList;
